ario, en formato [+-]HH:MM\r\n\r\nSi pone un nombre de usuario como parámetro, la configuración se aplicará solamente para ese usuario. Si el parámetro se deja en blanco la configuración será global.',0,'2012-09-13 03:12:22'),(238,'es','help_text_realtime_spy_device','Canal o Dispositivo del usuario utilizado para las escuchas, debe ponerse como parámetro el nombre del usuario y como valor el canal completo. Ej: SIP/1234',0,'2012-09-13 03:12:22'),(239,'es','help_text_sla_steps','Número de filas a mostrar en los reportes de Nivel de Servicio en Atendidas y No Atendidas.',0,'2012-09-13 03:12:22'),(240,'es','help_text_sla_interval','Intervalo de tiempo en segundos para separar los reportes de Nivel de Servicio en Atendidas y No Atendidas.',0,'2012-09-13 03:12:22'),(241,'es','help_text_show_agent_field','Mostrar columna de Agente en reportes de no atendidos (util cuando se rastrean llamados salientes)',0,'2012-09-13 03:12:22'),(242,'es','help_text_show_url_field','Mostrar columna de URL en los reportes de llamados atentidos',0,'2012-09-13 03:12:22'),(243,'es','help_text_show_agent_call','Mostrar eventos de llamado cuando se expanden reportes de Agente',0,'2012-09-13 03:12:22'),(244,'es','help_text_shared_lastcall','Compartir la información de último llamado entre colas. Sólo se mostrará el tiempo más corto para todas las colas. Si se utiliza rastreo de salientes y se guarda el valor astdb LASTCALL, será también tomado en cuenta.',0,'2012-09-13 03:12:22'),(245,'en','admin-users','Users',0,'2012-10-02 20:21:37'),(246,'es','help_text_session_time_format','Formato para campos de tiempo de sesión. HH = horas, MM=minutos, SS=segundos, mm=minutos absolutos, ss=segundos absolutos. Utilizado en reportes de información detallados y drill down.',0,'2012-09-13 03:12:22'),(247,'es','help_text_recordings_path','Directorio de grabaciones en el disco duro para descarga directa.',0,'2012-09-13 03:12:22'),(248,'es','help_text_realtime_refresh','Tiempo en segundos para refresco de la vista de &quot;Estado Actual&quote;. El valor por defecto es de 5 segundos.',0,'2012-09-13 03:12:22'),(249,'es','help_text_language','Idioma a usar. Si el parámetro se deja en blanco, se aplicará globalmente. En caso de que el parámetro sea el nombre de un usuario, entonces el idioma se aplicará solamente a ese usuario.',0,'2012-09-13 03:12:22'),(250,'es','help_text_short_abandon_threshold','Tiempo mínimo que una llamada debe tener (en segundos) para que sea considerada entre las llamadas abandonadas. Si se especifica como parámetro el nombre de una cola, entonces se aplicará para esa cola solamente.',0,'2012-09-13 03:12:22'),(251,'es','help_text_ignore_none_abandons','Si no desea contar las llamadas abadonadas entrantes cuando selecciona un reporte sobre una lista parcial de agentes debe poner este seteo en uno. Esto es util cuando se reporta sobre llamados salientes y determinar la performance de cada agente, ya que los abandons entrantes son filtrados debido a que no se puede computar un abandono entrante a ningun agente en particular. Si al ejecutar un reporte se seleccionan todos los agentes disponibles, esto incluira tambien el agente NONE por lo que los abandonos entrantes se contaran incluso si esta configuracion esta puesta en uno.',0,'2012-09-13 03:12:22'),(252,'es','help_text_honor_timeframe_in_agent','Honrar seleccion de horario en reportes de Agente. Tambien intenta computar eventos faltantes. (Por ejemplo, si en la selección de horario en la solapa inicial se pide un reporte de 11 a 16 horas, los reportes de agente computaran un fin de sesión a las 16 hs si no existe un evento de fin de sesión registrado).',0,'2012-09-13 03:12:22'),(253,'en','help_text_realtime_hide_loggedoff','Start the realtime view without showing logged off Agents.',0,'2012-10-02 07:55:45'),(254,'es','agent_durations','Duración de Sesión y Pausas de Agente',0,'2012-09-17 18:40:15'),(255,'en','admin-language','Translations',0,'2012-10-02 20:21:37'),(256,'en','admin-acl','Access Control'