 y Reportes programados, configure el nombre de usuario para autenticarse al servidor SMTP para enviar correos electr&oacute;nicos.',0,'2012-09-13 03:12:22'),(913,'en','New Email Alert','New Email Alert',0,'2012-10-02 08:43:07'),(914,'en','Scheduled Reports and Alerts','Scheduled Reports and Alerts',0,'2012-10-02 08:43:07'),(915,'en','Email','Email',0,'2012-10-02 08:43:07'),(916,'en','Reports','Reports',0,'2012-10-02 08:43:07'),(917,'en','Type','Type',0,'2012-10-02 08:43:07'),(918,'en','Alert','Alert',0,'2012-10-02 08:43:07'),(919,'en','Report','Report',0,'2012-10-02 08:43:07'),(920,'en','Queues','Queues',0,'2012-10-02 02:08:44'),(921,'es','Queues','Colas',0,'2012-09-13 03:35:09'),(922,'es','help_text_ACTION','Define un controlador de acci&oacute;n personalizado, para que pueda llamar a sus propias funciones/programas para casos especiales. Debe crear la funci&oacute;n javascript en el archivo js/custom.js . Recibir&aacute; el valor de UNIQUEID de la llamada cuando el icono de acci&oacute;n es clickado.\r\n\r\nparametro: posici&oacute;n,imagen de icono,Tooltip\r\nvalue: javascript_function',0,'2012-09-08 02:21:56'),(923,'es','Scheduled Reports and Alerts','Informes y Alertas Programados',0,'2012-09-13 03:37:57'),(924,'es','Reports','Informes',0,'2012-09-13 03:37:57'),(925,'es','Type','Tipo',0,'2012-09-13 03:37:57'),(926,'es','Alert','Alerta',0,'2012-09-13 03:37:57'),(927,'es','Report','Informe',0,'2012-09-13 03:37:57'),(928,'en','help_text_ACTION','Define a custom action handler, so you can call your own functions/program to handle special cases. You must create the javascript function in the js/custom.js file. It will receive the uniqueid of the call when the action icon is clicked.<br/>\r\n<br/>\r\nparameter: position,icon image,Tooltip<br/>\r\nvalue: javascript_function',0,'2012-10-02 08:42:51'),(929,'en','help_text_ANSWERED_DISPLAY_GRID','If a chart is defined in the answered reports tab, parameter field, then use the grid layout width as setup in the value field. The grid system has 12 columns in total:<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: width1,width2',0,'2012-10-02 08:42:51'),(930,'en','help_text_ANSWERED_DISPLAY_ROWS','Comma separated list of fields to show on a specific Answered reports. The fields are the one defined as COLUMN_ANSWERED.<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: comma separated list of fields ',0,'2012-10-02 08:42:51'),(931,'en','help_text_CHART_ANSWERED','Shows a chart into the Answered reports page.<br/><br/>\n\nparameter: position,group field,title<br/>\nvalue: field,field',0,'2012-10-02 08:42:51'),(932,'en','help_text_CHART_DISTRIBUTION','Shows a chart into the Distribution reports page.<br/><br/>\r\n\r\nparameter: position,group field,title<br/>\r\nvalue: field,field',0,'2012-10-02 08:42:51'),(933,'en','help_text_CHART_UNANSWERED','Shows a chart into the Unanswered reports page.<br/><br/>\r\n\r\nparameter: position,group field,title<br/>\r\nvalue: field,field',0,'2012-10-02 08:42:51'),(934,'en','help_text_COLUMN_ANSWERED','Column to show in Answered reports. You can add all the columns you want for a report, then you can filter limit them on each group report by enumerating them in ANSWERED_DISPLAY_ROWS entries.<br/>\r\n<br/>\r\nparameter: column name/label<br/>\r\nvalue: variable or formula<br/>\r\n\r\n\r\n',0,'2012-10-02 08:42:51'),(935,'en','help_text_COLUMN_ANSWERED_FORMAT','Format to use for displaying a cell value in the answered reports. It uses regular printf formatting rules, except for hourly values that can use {HH}, {MM}, {SS}, {mm} and {ss}<br/>\r\n<br/>\r\nparameter: field name<br/>\r\nvalue: format string<br/>\r\n<br/>\r\nThe parameter field name must be set as the parameter field on the COLUMN_ANSWERED entry.<br/>\r\nFormat Examples:<br/><br/>\r\nGiven a value in seconds, convert it to HH:MM:SS with:<br/>\r\n{HH}:{MM}:{SS}\r\n',0,'2012-10-02 08:42:51'),(936,'en','help_text_COLUMN_DISTRIBUTION','Column to show in Distribution reports. You can add all the columns you want for a report, then you can filter limit them on each group report by enumerating them in DISTRIBUTION_DISPLAY_ROWS entries.<br/>\r\n<br/>\r\nparameter: column name/label<br/>\r\nvalue: variable or formula<br/>\r\n',0,'2012-10-02 08:42:51'),(937,'en','help_text_COLUMN_DISTRIBUTION_FORMAT','Format to use for displaying a cell value in the distribution reports. It uses regular printf formatting rules, except for hourly values that can use {HH}, {MM}, {SS}, {mm} and {ss}<br/>\r\n<br/>\r\nparameter: field name<br/>\r\nvalue: format string<br/>\r\n<br/>\r\nThe parameter field name must be set as the parameter field on the COLUMN_DISTRIBUTION entry.<br/>\r\nFormat Examples:<br/><br/>\r\nGiven a value in seconds, convert it to HH:MM:SS with:<br/>\r\n{HH}:{MM}:{SS}\r\n',0,'2012-10-02 08:42:51'),(938,'en','help_text_COLUMN_REALTIME','Column to show in the Realtime summary. You can add all the columns you want for a report, then you can filter limit them on each group report by enumerating them in REALTIME_DISPLAY_ROWS entries.<br/>\r\n<br/>\r\nparameter: column name/label<br/>\r\nvalue: variable or formula<br/>\r\n',0,'2012-10-02 08:42:51'),(939,'en','help_text_COLUMN_REALTIME_FORMAT','Format to use for displaying a cell value in the realtime queue summary report. It uses regular printf formatting rules, except for hourly values that can use {HH}, {MM}, {SS}, {mm} and {ss}<br/>\r\n<br/>\r\nparameter: field name<br/>\r\nvalue: format string<br/>\r\n<br/>\r\nThe parameter field name must be set as the parameter field on the COLUMN_REALTIME entry.<br/>\r\nFormat Examples:<br/><br/>\r\nGiven a value in seconds, convert it to HH:MM:SS with:<br/>\r\n{HH}:{MM}:{SS}\r\n',0,'2012-10-02 08:42:51'),(940,'en','help_text_COLUMN_REALTIME_STYLE','Extra html property to add to cell values in the realtime queue summary table. You can use class or style to modify display on those cells. Example:<br/>\r\n<br/>\r\nclass=&quot;bigblue&quot;\r\n<br/>\r\nstyle=&quot;border:1px solid red;&quot;\r\n\r\n',0,'2012-10-02 08:42:51'),(941,'en','help_text_COLUMN_UNANSWERED','Column to show in Unanswered reports. You can add all the columns you want for a report, then you can filter limit them on each group report by enumerating them in UNANSWERED_DISPLAY_ROWS entries.<br/>\r\n<br/>\r\nparameter: column name/label<br/>\r\nvalue: variable or formula<br/>\r\n',0,'2012-10-02 08:42:51'),(942,'en','help_text_COLUMN_UNANSWERED_FORMAT','Format to use for displaying a cell value in the unanswered reports. It uses regular printf formatting rules, except for hourly values that can use {HH}, {MM}, {SS}, {mm} and {ss}<br/>\r\n<br/>\r\nparameter: field name<br/>\r\nvalue: format string<br/>\r\n<br/>\r\nThe parameter field name must be set as the parameter field on the COLUMN_UNANSWERED entry.<br/>\r\nFormat Examples:<br/><br/>\r\nGiven a value in seconds, convert it to HH:MM:SS with:<br/>\r\n{HH}:{MM}:{SS}\r\n',0,'2012-10-02 08:42:51'),(943,'en','help_text_DISTRIBUTION_DISPLAY_ROWS','Comma separated list of fields to show on a specific Distribution reports. The fields are the one defined as COLUMN_DISTRIBUTION.<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: comma separated list of fields',0,'2012-10-02 08:42:51'),(944,'en','help_text_EVENT_ABANDONED','Define the queue_log events that will count towards the ABANDONED counters/variables in reports, using a comma separated list. In a standard Asterisk setup, this must be set to \\\"ABANDON\\\" and nothing else.',0,'2012-10-02 08:42:51'),(945,'en','help_text_EVENT_ANSWERED','Define the queue_log events that will count towards the ANSWERED counters/variables in reports, using a comma separated list. Normal answered dispositions in the queue_log are COMPLETECALLER, COMPLETEAGENT, you could also want to count the TRANSFER disposition towards the ANSWERED column, but as transfers have their own variable, you can also leave them separated.',0,'2012-10-02 08:42:51'),(946,'en','help_text_EVENT_LOGIN','Define the queue_log events that will count towards the LOGIN counters/variables in reports, using a comma separated list. Usually you have AGENTLOGIN and ADDMEMBER as events for login events in the queue_log file. Old asterisk versions could also use AGENTCALLBACKLOGIN.',0,'2012-10-02 08:42:51'),(947,'en','help_text_EVENT_LOGOUT','Define the queue_log events that will count towards the LOGOUT counters/variables in reports, using a comma separated list. Usually you have AGENTLOGOFF and REMOVEMEMBER as events for login events in the queue_log file.',0,'2012-10-02 08:42:51'),(948,'en','help_text_EVENT_RECEIVED','Define the queue_log events that will count towards the RECEIVED counters/variables in reports, using a comma separated list. All dispositions on the queue_log file that should add to a received call should be listed here, for example:<br/><br/>\r\nCOMPLETECALLER,COMPLETEAGENT,ABANDON,EXITEMPTY,EXITWITHKEY,EXITWITHTIMEOUT,TRANSFER',0,'2012-10-02 08:42:51'),(949,'en','help_text_EVENT_TRANSFERRED','Define the queue_log events that will count towards the TRANSFERRED counters/variables in reports, using a comma separated list. In a regular Asterisk setup, the only event associated with transfers is TRANSFER.',0,'2012-10-02 08:42:51'),(950,'en','help_text_EVENT_UNANSWERED','Define the queue_log events that will count towards the UNANSWERED counters/variables in reports, using a comma separated list. As an abandon call has its own variable, you should list here the rest of the unanswered dispositions, for example:<br/><br/>\r\nEXITWITHKEY,EXITEMPTY,EXITWITHTIMEOUT',0,'2012-10-02 08:42:51'),(951,'en','help_text_REALTIME_DISPLAY_ROWS','Comma separated list of fields to show on the Realtime Queue Summary table. The fields are the one defined as COLUMN_REALTIME.<br/>\r\n<br/>\r\nparameter: group field (queue_summary)<br/>\r\nvalue: comma separated list of fields',0,'2012-10-02 08:42:51'),(952,'en','help_text_TOTAL_COLUMN_ANSWERED','Formula to use for the Total row on Answered reports.<br/>\r\n<br/>\r\nparameter: field<br/>\r\nvalue: formula',0,'2012-10-02 08:42:51'),(953,'en','help_text_TOTAL_COLUMN_DISTRIBUTION','Formula to use for the Total row on Distribution reports.<br/>\r\n<br/>\r\nparameter: field<br/>\r\nvalue: formula',0,'2012-10-02 08:42:51'),(954,'en','help_text_TOTAL_COLUMN_REALTIME','Formula to use for the Total row on Realtime reports.<br/>\r\n<br/>\r\nparameter: field<br/>\r\nvalue: formula',0,'2012-10-02 08:42:51'),(955,'en','help_text_TOTAL_COLUMN_UNANSWERED','Formula to use for the Total row on Unanswered reports.<br/>\r\n<br/>\r\nparameter: field<br/>\r\nvalue: formula',0,'2012-10-02 08:42:51'),(956,'en','help_text_UNANSWERED_DISPLAY_GRID','If a chart is defined in the unanswered reports, parameter field, then use the grid layout width as setup in the value field. The grid system has 12 columns in total:<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: width1,width2',0,'2012-10-02 08:42:51'),(957,'en','help_text_UNANSWERED_DISPLAY_ROWS','Comma separated list of fields to show on a specific Unanswered reports. The fields are the one defined as COLUMN_UNANSWERED.<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: comma separated list of fields',0,'2012-10-02 08:42:51'),(958,'en','help_text_agent_reports','Comma separated list of reports to show on the Agent page. You must specify the correct .php file that displays the report you want on each element.',0,'2012-10-02 08:42:51'),(959,'en','help_text_answered_reports','Comma separated list of reports to show on the Answered page. You must specify the correct .php file that displays the report you want on each element.',0,'2012-10-02 08:42:51'),(960,'en','help_text_distribution_reports','Comma separated list of reports to show on the Distribution page. You must specify the correct .php file that displays the report you want on each element.',0,'2012-10-02 08:42:51'),(961,'en','help_text_realtime_reports','Comma separated list of reports to show on the Realtime page. You must specify the correct .php file that displays the report you want on each element.',0,'2012-10-02 08:42:51'),(962,'en','help_text_setup_reports','Comma separated list of reports to show on the Setup page. You must specify the correct .php file that displays the report you want on each element.',0,'2012-10-02 08:42:51'),(963,'en','help_text_unanswered_reports','Comma separated list of reports to show on the Unanswered page. You must specify the correct .php file that displays the report you want on each element.',0,'2012-10-02 08:42:51'),(964,'es','help_text_ANSWERED_DISPLAY_ROWS','Listado de campos separados por coma para mostrarse en los reportes de Atendidas. Los campos se definen como COLUMN_ANSWERED\r\n\r\nparametro: group field\r\nvalor: listado de campos separados por coma ',0,'2012-09-08 02:21:56'),(965,'es','help_text_CHART_ANSWERED','Muestra un diagrama dentro de la p&aacute;gina de Atendidas.\r\n\r\nparametro: posicion,group field,titulo\r\nvalor: campo,campo',0,'2012-09-08 02:21:56'),(966,'es','help_text_CHART_DISTRIBUTION','Muestra un diagrama dentro de la p&aacute;gina de Distribuci&oacute;n.\r\n\r\nparametro: posicion,group field,titulo\r\nvalor: campo,campo',0,'2012-09-08 02:21:56'),(967,'es','help_text_CHART_UNANSWERED','Muestra un diagrama dentro de la p&aacute;gina de Desatendidas.\r\n\r\nparametro: posicion,group field,titulo\r\nvalor: campo,campo',0,'2012-09-08 02:21:56'),(968,'es','help_text_COLUMN_ANSWERED','Columna para mostrar dentro de los reportes de Atendidas. Puede agregar todas las columnas que usted quiera a un reporte, luego podr&aacute; limitarlas en cada grupo enumerandolas con ANSWERED_DISPLAY_ROWS.\r\n\r\nparametro: nombre columna/etiqueta\r\nvalor: variable o f&oacute;rmula',0,'2012-09-08 02:21:56'),(969,'es','help_text_COLUMN_ANSWERED_FORMAT','Formato para mostrar en el valor de la celda en los reportes de Atendidas. Utiliza las t&iacute;picas reglas de formato de printf, excepto por los valores horarios que pueden usar tambi&eacute;n \r\n{HH}, {MM}, {SS}, {mm} y {ss}\r\n\r\npar&aacute;metro: nombre de campo\r\nvalor: cadena de formato\r\n\r\nEl par&aacute;metro nombre de campo debe ser definido como el campo de par&aacute;metro en COLUMN_ANSWERED.\r\n\r\nFormato de Ejemplo:\r\n\r\nDado un valor en segundos, convertirlo a HH:MM:SS con:\r\n\r\n{HH}:{MM}:{SS} ',0,'2012-09-08 02:21:56'),(970,'es','help_text_COLUMN_DISTRIBUTION','Columna a mostrar en los reportes de Distribuci&oacute;n. Puede agregar todas las columnas que quiera a cada reporte, luego puede limitarlos filtrando en cada grupo enumerandolos en DISTRIBUTION_DISPLAY_ROWS.\r\n\r\nparametro: nombre de columna/etiqueta\r\nvalue: variable o f&oacute;rmula\r\n',0,'2012-09-08 02:21:56'),(971,'es','help_text_COLUMN_DISTRIBUTION_FORMAT','Formato para mostrar el valor de la celda en los reportes de distribuci&oacute;n. Usa las t&iacute;picas reglas de formato de printf, excepto por los valores horarios que pueden usar\r\n{HH}, {MM}, {SS}, {mm} y {ss}\r\n\r\nparametro: nombre del campo\r\nvalor: cadena de formato\r\n\r\nEl par&aacute;metro nombre del campo debe ser definido en COLUMN_DISTRIBUTION.\r\nEjemplos de Formato:\r\n\r\nDado un valor en segundos, convertirlo a HH:MM:SS con:\r\n{HH}:{MM}:{SS} ',0,'2012-09-08 02:21:56'),(972,'es','help_text_COLUMN_REALTIME','Columna a mostrar en el sumario de la vista REALTIME. Puede agregar todas las columnas que quiera al reporte, luego puede filtrarlas en cada reporte enumerandolas en REATIME_DISPLAY_ROWS.\r\n\r\nparametro: nombre de columna/etiqueta\r\nvalor: variable o f&oacute;rmula',0,'2012-09-08 02:21:56'),(973,'es','help_text_COLUMN_REALTIME_FORMAT','Formato a utilizar para mostrar el valor de una columna en el sumario de Realtime. Usa las t&iacute;picas reglas de formato de printf, excepto por los valores horarios que puede utilizar {HH}, {MM}, {SS}, {mm} y {ss}\r\n\r\nparametro: nombre del campo\r\nvalor: cadena con el formato\r\n\r\nEl par&aacute;metro nombre del campo debe ser definido en COLUMN_REALTIME.\r\nEjemplo de Formato:\r\n\r\nDado un valor en segundos, convertirlo a HH:MM:SS con:\r\n{HH}:{MM}:{SS} ',0,'2012-09-08 02:21:56'),(974,'es','help_text_COLUMN_REALTIME_STYLE','Propiedad HTML extra para adicionar a los valores de las celdas en el sumario de REALTIME. Puede usar class o style para modificar la visualizaci&oacute;n de la celda. Ejemplo:\r\n\r\nclass=\\\"bigblue\\\"\r\nstyle=\\\"border:1px solid red;\\\" ',0,'2012-09-08 02:21:56'),(975,'es','help_text_variable_AGENTS_TALKING','N&uacute;mero de agentes con una llamada establecida. S&oacute;lo disponible en f&oacute;rmulas de COLUMN_REALTIME.',0,'2012-09-08 02:21:56'),(976,'es','help_text_COLUMN_UNANSWERED','Columna para ser mostrada en los reportes de Desatendidas. Puede agregar todas las columnas que desee a un reporte, luego podr&aacute; filtrarlos en cada grupo enumerandolas en UNANSWERED_DISPLAY_ROWS.\r\n\r\nparametro: nombre de columna/etiqueta\r\nvalor: variable o f&oacute;rmula',0,'2012-09-08 02:21:56'),(977,'es','help_text_COLUMN_UNANSWERED_FORMAT','Formato a utilizar para mostrar en las celdas de reportes de desatendidas. Usa las t&iacute;picas reglas de formato de printf, excepto por los valores de horarios que puede utilizar {HH}, {MM}, {SS}, {mm} y {ss}\r\n\r\nparametro: nombre del campo\r\nvalor: cadena de formato\r\n\r\nEl par&aacute;metro nombre de campo debe ser definido en COLUMN_UNANSWERED.\r\nEjemplo de formato:\r\n\r\nDado un valor en segundos, convertirlo a HH:MM:SS con:\r\n{HH}:{MM}:{SS} ',0,'2012-09-08 02:21:56'),(978,'es','help_text_DISTRIBUTION_DISPLAY_ROWS','Listado de campos separados por coma para mostrar en un reporte específico de Distribui&oaucte;n. Los campos son los definidos en COLUMN_DISTRIBUTION.\r\n\r\nparametro: group field\r\nvalor: lista de campos separados por coma',0,'2012-09-08 02:21:56'),(979,'es','help_text_EVENT_ABANDONED','Define los eventos de queue_log que incrementarán los contadores/variables de llamadas Abandonadas usando un listado separado por coma. Dentro de la configuraci&oacute;n est&aacute;ndar de Asterisk, esto debe ser definido como &quot;ABANDON&quot; y nada m&aacute;s.',0,'2012-09-08 02:21:56'),(980,'es','help_text_EVENT_ANSWERED','Define los eventos de queue_log que incrementarán los contadores/variables de llamadas Atendidas en los reportes, usando un listado separado por coma. Las disposiciones usuales de llamadas atendidas dentro de la configuraci&oacute;n est&aacute;ndar de Asterisk son COMPLETECALLER y COMPLETEAGENT. Podría también incluirse la disposición TRANSFER. Pero tenga en cuenta que las transferencias disponen de su propio evento/variable por si desea reportearlas de forma separada.',0,'2012-09-08 02:21:56'),(981,'es','help_text_EVENT_LOGIN','Define los eventos de queue_log que incrementarán los contadores/variables de ingreso de agentes en los reportes, usando un listado separado por coma. En una configuración normal de Asterisk dichos eventos son AGENTLOGIN y ADDMEMBER. Versiones antiguas de Asterisk podrían incluir AGENTCALLBACKLOGIN.',0,'2012-09-08 02:21:56'),(982,'es','help_text_EVENT_LOGOUT','Define los eventos de queue_log que incrementarán los contadores/variables de egreso/desconexión de agentes en los reportes, usando un listado separado por coma. En una configuración normal de Asterisk dichos eventos son AGENTLOGOFF y REMOVEMEMBER.',0,'2012-09-08 02:21:56'),(983,'es','help_text_EVENT_RECEIVED','Define los eventos de queue_log que incrementarán los contadores/variables de llamadas Recibidas usando un listado separado por coma. Todas las disposiciones que figuren en el queue_log que deban sumar como llamada recibida, tanto atendida como no, deberán ser listadas aquí, por ejemplo:<br/><br/>\r\nCOMPLETECALLER,COMPLETEAGENT,ABANDON,EXITEMPTY,EXITWITHKEY,EXITWITHTIMEOUT,TRANSFER',0,'2012-09-08 02:21:56'),(984,'es','help_text_EVENT_TRANSFERRED','Define los eventos de queue_log que incrementarán los contadores/variables de llamadas Transferidas usando un listado separado por coma. En instalaciones normales, el único evento a listar es TRANSFER',0,'2012-09-08 02:21:56'),(985,'es','help_text_EVENT_UNANSWERED','Define los eventos de queue_log que incrementarán los contadores/variables de llamadas No Atendidas usando un listado separado por coma. A diferencia de un Abandono, done el llamado no es atendido porque el llamante corta la llamada antes de ser atendido por un agente, las disposiciones de No Atendidas listan las razones por las cuales un llamado puede salirse de la espera en cola por otros motivos, como ser tiempo máximo de espera, salida por pulsación de tecla, etc. Los eventos usuales son: EXITWITHKEY,EXITEMPTY,EXITWITHTIMEOUT',0,'2012-09-08 02:21:56'),(986,'es','help_text_REALTIME_DISPLAY_ROWS','Lista separada por comas de los campos a mostrar en la tabla de sumario de tiempo real. Los campos posibles son los definidos en COLUMN_REALTIME.<br/>\r\n<br/>\r\nparameter: campo agrupado<br/>\r\nvalue: lista de campos separados por coma',0,'2012-09-08 02:21:56'),(987,'es','help_text_TOTAL_COLUMN_ANSWERED','Formula a usar para la fila Total en los reportes de llamados Atendidos.<br/>\r\n<br/>\r\nparameter: campo<br/>\r\nvalue: formula',0,'2012-09-08 02:21:56'),(988,'es','help_text_TOTAL_COLUMN_DISTRIBUTION','Formula a usar para la fila Total en los reportes de Distribución.<br/>\r\n<br/>\r\nparameter: campo<br/>\r\nvalue: formula',0,'2012-09-08 02:21:56'),(989,'es','help_text_TOTAL_COLUMN_REALTIME','Formula a usar para la fila Total en los reportes de Tiempo Real.<br/>\r\n<br/>\r\nparameter: campo<br/>\r\nvalue: formula',0,'2012-09-08 02:21:56'),(990,'es','help_text_TOTAL_COLUMN_UNANSWERED','Formula a usar para la fila Total en los reportes de llamados No Atendidos.<br/>\r\n<br/>\r\nparameter: campo<br/>\r\nvalue: formula',0,'2012-09-08 02:21:56'),(991,'es','help_text_UNANSWERED_DISPLAY_GRID','Si una gráfica está definida en los reportes de llamadas no atendidas, entonces utilizar la disposición de ancho de grilla de acuerdo a los valores especificados en la campo value. La grilla tiene 12 columnas en total. Ejemplo:<br>\r\n<br>\r\nparameter: campo agrupadogroup field\r\nvalue: 6,6',0,'2012-09-08 02:21:56'),(992,'es','help_text_UNANSWERED_DISPLAY_ROWS','Listado de campos separados por coma para mostrarse en los reportes de No Atendidas. Los campos se definen como COLUMN_UNANSWERED<br><br>\r\n\r\nparametro: group field\r\nvalor: listado de campos separados por coma ',0,'2012-09-08 02:21:56'),(993,'es','help_text_agent_reports','Lista separada por comas de los reportes a mostrar en la solapa de Agente. Debe especificar el listado correcto de archivos .php para mostrar en cada elemento/sección.\r\n',0,'2012-09-08 02:21:56'),(994,'es','help_text_answered_reports','Lista separada por comas de los reportes a mostrar en la solapa de Atendidos. Debe especificar el listado correcto de archivos .php para mostrar en cada elemento/sección.\r\n',0,'2012-09-08 02:21:56'),(995,'es','help_text_distribution_reports','Lista separada por comas de los reportes a mostrar en la solapa de Distribución. Debe especificar el listado correcto de archivos .php para mostrar en cada elemento/sección.\r\n',0,'2012-09-08 02:21:56'),(996,'es','help_text_realtime_reports','Lista separada por comas de los reportes a mostrar en la solapa de Tiempo Real. Debe especificar el listado correcto de archivos .php para mostrar en cada elemento/sección.\r\n',0,'2012-09-08 02:21:56'),(997,'es','help_text_setup_reports','Lista separada por comas de los reportes a mostrar en el menú de Configuración. Debe especificar el listado correcto de archivos .php para mostrar en cada elemento/sección.\r\n',0,'2012-09-08 02:21:56'),(998,'es','help_text_unanswered_reports','Lista separada por comas de los reportes a mostrar en la solapa de No Atendidas. Debe especificar el listado correcto de archivos .php para mostrar en cada elemento/sección.\r\n',0,'2012-09-08 02:21:56'),(999,'es','Select the report to check','Elija el reporte a verificar',0,'