swered by Queue',1,'2012-10-02 02:17:33'),(1900,'fr','answered_calls_by_url','Answered by URL',1,'2012-10-02 02:17:33'),(1901,'fr','answered_calls_detail','Answered Calls Detail',1,'2012-10-02 02:17:33'),(1902,'fr','answered_calls_summary','Answered Calls Summary',1,'2012-10-02 02:17:33'),(1903,'fr','answered_calls_transferred','Transfers',1,'2012-10-02 02:17:33'),(1904,'fr','at hour','at hour',1,'0000-00-00 00:00:00'),(1905,'fr','at minute','at minute',1,'0000-00-00 00:00:00'),(1906,'fr','calls','calls',1,'2012-10-02 02:17:33'),(1907,'fr','day','day',1,'0000-00-00 00:00:00'),(1908,'fr','disposition_help_ABANDON','The caller abandoned their position in the queue. The position is the\r\ncaller&rsquo;s position in the queue when they hungup, the origposition is\r\nthe original position the caller was when they first entered the\r\nqueue, and the waittime is how long the call had been waiting in the\r\nqueue at the time of disconnect.',1,'2012-10-02 02:17:33'),(1909,'fr','disposition_help_COMPLETEAGENT','The caller was connected to an agent, and the call was terminated normally\r\nby the *agent*. The caller&lsquo;s hold time and the length of the call are both\r\nrecorded. The caller&lsquo;s original position in the queue is recorded in\r\norigposition.',1,'2012-10-02 02:17:33'),(1910,'fr','disposition_help_COMPLETECALLER','The caller was connected to an agent, and the call was terminated normally\r\nby the *caller*. The callers hold time and the length of the call are both\r\nrecorded. The caller&rsquo;s original position in the queue is recorded in\r\norigposition.\r\n',1,'2012-10-02 02:17:33'),(1911,'fr','disposition_help_CONNECT','The caller was connected to an agent.',1,'2012-10-02 02:17:33'),(1912,'fr','disposition_help_ENTERQUEUE','A caller entered the queue. Three parameters are also written: the URL (if specified) in the Info 1 field and the caller ID of the caller on the Info 2 field, and the original position where the call has landed in the Info 3 field.',1,'2012-10-02 02:17:33'),(1913,'fr','disposition_help_EXITWITEMPTY','The caller was exited from the queue forcefully because the queue had no\r\nreachable members and it&lsquo;s configured to do that to callers when there\r\nare no reachable members. The position is the caller&lsquo;s position in the\r\nqueue when they hungup, the origposition is the original position the\r\ncaller was when they first entered the queue, and the waittime is how\r\nlong the call had been waiting in the queue at the time of disconnect.',1,'2012-10-02 02:17:33'),(1914,'fr','disposition_help_EXITWITHKEY','The caller elected to use a menu key to exit the queue. The key and\r\nthe caller&lsquo;s position in the queue are recorded.\r\n',1,'2012-10-02 02:17:33'),(1915,'fr','disposition_help_EXITWITHTIMEOUT','The caller was on hold too long and the timeout expired.',1,'2012-10-02 02:17:33'),(1916,'fr','disposition_help_RINGNOANSWER','The timeout value for ringing the queue member was exceeded. A single parameter will also be written indicating the amount of time the member’s extension rang in the Info 1 field.',1,'2012-10-02 02:17:33'),(1917,'fr','disposition_help_TRANSFER','Caller was transferred to a different extension. Context and extension\r\nare recorded. The caller&lsquo;s hold time and the length of the call are both\r\nrecorded. PLEASE remember that transfers performed by SIP UA&lsquo;s by way\r\nof a reinvite may not always be caught by Asterisk and trigger off this\r\nevent. The only way to be 100% sure that you will get this event when\r\na transfer is performed by a queue member is to use the built-in transfer\r\nfunctionality of Asterisk.',1,'2012-10-02 02:17:33'),(1918,'fr','distribution_by_day','Distribution per Day',1,'2012-10-02 02:17:33'),(1919,'fr','distribution_by_day_of_week','Distribution per Day of Week',1,'2012-10-02 02:17:33'),(1920,'fr','distribution_by_hour','Distribution per Hour',1,'2012-10-02 02:17:33'),(1921,'fr','distribution_by_month','Distribution per Month',