r was when exiting the queue.',1,'0000-00-00 00:00:00'),(1955,'fr','event_help_exitwithtimeout_info2','Original position at which the called entered the queue.',1,'0000-00-00 00:00:00'),(1956,'fr','event_help_exitwithtimeout_info3','Amount of time the caller waited in the queue.',1,'0000-00-00 00:00:00'),(1957,'fr','event_help_pause_info1','Pause reason if any',1,'0000-00-00 00:00:00'),(1958,'fr','event_help_ringnoanswer_info1','Time in milliseconds the agent phone rang until the timeout was reached. The attempt ended without the member picking up the call. Bad queue member!',1,'0000-00-00 00:00:00'),(1959,'fr','event_help_transfer_info1','The extension',1,'0000-00-00 00:00:00'),(1960,'fr','event_help_transfer_info2','The context',1,'0000-00-00 00:00:00'),(1961,'fr','event_help_transfer_info3','The caller&#39;s hold time',1,'0000-00-00 00:00:00'),(1962,'fr','event_help_transfer_info4','The length of the call.',1,'0000-00-00 00:00:00'),(1963,'fr','event_help_transfer_info5','The caller&#39;s entry position at the time of the transfer.',1,'0000-00-00 00:00:00'),(1964,'fr','event_help_unpause_info1','Unpause reason if any',1,'0000-00-00 00:00:00'),(1965,'fr','every day','every day',1,'0000-00-00 00:00:00'),(1966,'fr','every hour','every hour',1,'0000-00-00 00:00:00'),(1967,'fr','every minute','every minute',1,'0000-00-00 00:00:00'),(1968,'fr','help_text_ACTION','Define a custom action handler, so you can call your own functions/program to handle special cases. You must create the javascript function in the js/custom.js file. It will receive the uniqueid of the call when the action icon is clicked.<br/>\r\n<br/>\r\nparameter: position,icon image,Tooltip<br/>\r\nvalue: javascript_function',1,'0000-00-00 00:00:00'),(1969,'fr','help_text_ANSWERED_DISPLAY_GRID','If a chart is defined in the answered reports tab, parameter field, then use the grid layout width as setup in the value field. The grid system has 12 columns in total:<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: width1,width2',1,'0000-00-00 00:00:00'),(1970,'fr','help_text_ANSWERED_DISPLAY_ROWS','Comma separated list of fields to show on a specific Answered reports. The fields are the one defined as COLUMN_ANSWERED.<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: comma separated list of fields ',1,'0000-00-00 00:00:00'),(1971,'fr','help_text_CHART_ANSWERED','Shows a chart into the Answered reports page.<br/><br/>\n\nparameter: position,group field,title<br/>\nvalue: field,field',1,'0000-00-00 00:00:00'),(1972,'fr','help_text_CHART_DISTRIBUTION','Shows a chart into the Distribution reports page.<br/><br/>\r\n\r\nparameter: position,group field,title<br/>\r\nvalue: field,field',1,'0000-00-00 00:00:00'),(1973,'fr','help_text_CHART_SERIES_COLOR','Colors to use for charts. Parameter is the index position, and value the hex html color.',1,'0000-00-00 00:00:00'),(1974,'fr','help_text_CHART_UNANSWERED','Shows a chart into the Unanswered reports page.<br/><br/>\r\n\r\nparameter: position,group field,title<br/>\r\nvalue: field,field',1,'0000-00-00 00:00:00'),(1975,'fr','help_text_COLUMN_ANSWERED','Column to show in Answered reports. You can add all the columns you want for a report, then you can filter limit them on each group report by enumerating them in ANSWERED_DISPLAY_ROWS entries.<br/>\r\n<br/>\r\nparameter: column name/label<br/>\r\nvalue: variable or formula<br/>\r\n\r\n\r\n',1,'0000-00-00 00:00:00'),(1976,'fr','help_text_COLUMN_ANSWERED_FORMAT','Format to use for displaying a cell value in the answered reports. It uses regular printf formatting rules, except for hourly values that can use {HH}, {MM}, {SS}, {mm} and {ss}<br/>\r\n<br/>\r\nparameter: field name<br/>\r\nvalue: format string<br/>\r\n<br/>\r\nThe parameter field name must be set as the parameter field on the COLUMN_ANSWERED entry.<br/>\r\nFormat Examples:<br/><br/>\r\nGiven a value in seconds, convert it to HH:MM:SS with:<br/>\r\n{HH}:{MM}:{SS}\r\n',1,'0000-00-00 00:00:00'),(1977,'fr','help_text_COLUMN_DISTRIBUTION','Column to show in Distribution reports. You can add all the columns you want for a report, then you can filter limit them on each group report by enumerating them in DISTRIBUTION_DISPLAY_ROWS entries.<br/>\r\n<br/>\r\nparameter: column name/label<br/>\r\nvalue: variable or formula<br/>\r\n',1,'0000-00-00 00:00:00'),(1978,'fr','help_text_COLUMN_DISTRIBUTION_FORMAT','Format to use for displaying a cell value in the distribution reports. It uses regular printf formatting rules, except for hourly values that can use {HH}, {MM}, {SS}, {mm} and {ss}<br/>\r\n<br/>\r\nparameter: field name<br/>\r\nvalue: format string<br/>\r\n<br/>\r\nThe parameter field name must be set as the parameter field on the COLUMN_DISTRIBUTION entry.<br/>\r\nFormat Examples:<br/><br/>\r\nGiven a value in seconds, convert it to HH:MM:SS with:<br/>\r\n{HH}:{MM}:{SS}\r\n',1,'0000-00-00 00:00:00'),(1979,'fr','help_text_COLUMN_REALTIME','Column to show in the Realtime summary. You can add all the columns you want for a report, then you can filter limit them on each group report by enumerating them in REALTIME_DISPLAY_ROWS entries.<br/>\r\n<br/>\r\nparameter: column name/label<br/>\r\nvalue: variable or formula<br/>\r\n',1,'0000-00-00 00:00:00'),(1980,'fr','help_text_COLUMN_REALTIME_FORMAT','Format to use for displaying a cell value in the realtime queue summary report. It uses regular printf formatting rules, except for hourly values that can use {HH}, {MM}, {SS}, {mm} and {ss}<br/>\r\n<br/>\r\nparameter: field name<br/>\r\nvalue: format string<br/>\r\n<br/>\r\nThe parameter field name must be set as the parameter field on the COLUMN_REALTIME entry.<br/>\r\nFormat Examples:<br/><br/>\r\nGiven a value in seconds, convert it to HH:MM:SS with:<br/>\r\n{HH}:{MM}:{SS}\r\n',1,'0000-00-00 00:00:00'),(1981,'fr','help_text_COLUMN_REALTIME_STYLE','Extra html property to add to cell values in the realtime queue summary table. You can use class or style to modify display on those cells. Example:<br/>\r\n<br/>\r\nclass=&quot;bigblue&quot;\r\n<br/>\r\nstyle=&quot;border:1px solid red;&quot;\r\n\r\n',1,'0000-00-00 00:00:00'),(1982,'fr','help_text_COLUMN_UNANSWERED','Column to show in Unanswered reports. You can add all the columns you want for a report, then you can filter limit them on each group report by enumerating them in UNANSWERED_DISPLAY_ROWS entries.<br/>\r\n<br/>\r\nparameter: column name/label<br/>\r\nvalue: variable or formula<br/>\r\n',1,'0000-00-00 00:00:00'),(1983,'fr','help_text_COLUMN_UNANSWERED_FORMAT','Format to use for displaying a cell value in the unanswered reports. It uses regular printf formatting rules, except for hourly values that can use {HH}, {MM}, {SS}, {mm} and {ss}<br/>\r\n<br/>\r\nparameter: field name<br/>\r\nvalue: format string<br/>\r\n<br/>\r\nThe parameter field name must be set as the parameter field on the COLUMN_UNANSWERED entry.<br/>\r\nFormat Examples:<br/><br/>\r\nGiven a value in seconds, convert it to HH:MM:SS with:<br/>\r\n{HH}:{MM}:{SS}\r\n',1,'0000-00-00 00:00:00'),(1984,'fr','help_text_DISTRIBUTION_DISPLAY_ROWS','Comma separated list of fields to show on a specific Distribution reports. The fields are the one defined as COLUMN_DISTRIBUTION.<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: comma separated list of fields',1,'0000-00-00 00:00:00'),(1985,'fr','help_text_EVENT_ABANDONED','Define the queue_log events that will count towards the ABANDONED counters/variables in reports, using a comma separated list. In a standard Asterisk setup, this must be set to \\\"ABANDON\\\" and nothing else.',1,'0000-00-00 00:00:00'),(1986,'fr','help_text_EVENT_ANSWERED','Define the queue_log events that will count towards the ANSWERED counters/variables in reports, using a comma separated list. Normal answered dispositions in the queue_log are COMPLETECALLER, COMPLETEAGENT, you could also want to count the TRANSFER disposition towards the ANSWERED column, but as transfers have their own variable, you can also leave them separated.',1,'0000-00-00 00:00:00'),(1987,'fr','help_text_EVENT_LOGIN','Define the queue_log events that will count towards the LOGIN counters/variables in reports, using a comma separated list. Usually you have AGENTLOGIN and ADDMEMBER as events for login events in the queue_log file. Old asterisk versions could also use AGENTCALLBACKLOGIN.',1,'0000-00-00 00:00:00'),(1988,'fr','help_text_EVENT_LOGOUT','Define the queue_log events that will count towards the LOGOUT counters/variables in reports, using a comma separated list. Usually you have AGENTLOGOFF and REMOVEMEMBER as events for login events in the queue_log file.',1,'0000-00-00 00:00:00'),(1989,'fr','help_text_EVENT_RECEIVED','Define the queue_log events that will count towards the RECEIVED counters/variables in reports, using a comma separated list. All dispositions on the queue_log file that should add to a received call should be listed here, for example:<br/><br/>\r\nCOMPLETECALLER,COMPLETEAGENT,ABANDON,EXITEMPTY,EXITWITHKEY,EXITWITHTIMEOUT,TRANSFER',1,'0000-00-00 00:00:00'),(1990,'fr','help_text_EVENT_TRANSFERRED','Define the queue_log events that will count towards the TRANSFERRED counters/variables in reports, using a comma separated list. In a regular Asterisk setup, the only event associated with transfers is TRANSFER.',1,'0000-00-00 00:00:00'),(1991,'fr','help_text_EVENT_UNANSWERED','Define the queue_log events that will count towards the UNANSWERED counters/variables in reports, using a comma separated list. As an abandon call has its own variable, you should list here the rest of the unanswered dispositions, for example:<br/><br/>\r\nEXITWITHKEY,EXITEMPTY,EXITWITHTIMEOUT',1,'0000-00-00 00:00:00'),(1992,'fr','help_text_REALTIME_COLUMN_WIDTHS','help_text_REALTIME_COLUNN_WIDTHS',1,'0000-00-00 00:00:00'),(1993,'fr','help_text_REALTIME_DISPLAY_ROWS','Comma separated list of fields to show on the Realtime Queue Summary table. The fields are the one defined as COLUMN_REALTIME.<br/>\r\n<br/>\r\nparameter: group field (queue_summary)<br/>\r\nvalue: comma separated list of fields',1,'0000-00-00 00:00:00'),(1994,'fr','help_text_TOTAL_COLUMN_ANSWERED','Formula to use for the Total row on Answered reports.<br/>\r\n<br/>\r\nparameter: field<br/>\r\nvalue: formula',1,'0000-00-00 00:00:00'),(1995,'fr','help_text_TOTAL_COLUMN_DISTRIBUTION','Formula to use for the Total row on Distribution reports.<br/>\r\n<br/>\r\nparameter: field<br/>\r\nvalue: formula',1,'0000-00-00 00:00:00'),(1996,'fr','help_text_TOTAL_COLUMN_REALTIME','Formula to use for the Total row on Realtime reports.<br/>\r\n<br/>\r\nparameter: field<br/>\r\nvalue: formula',1,'0000-00-00 00:00:00'),(1997,'fr','help_text_TOTAL_COLUMN_UNANSWERED','Formula to use for the Total row on Unanswered reports.<br/>\r\n<br/>\r\nparameter: field<br/>\r\nvalue: formula',1,'0000-00-00 00:00:00'),(1998,'fr','help_text_UNANSWERED_DISPLAY_GRID','If a chart is defined in the unanswered reports, parameter field, then use the grid layout width as setup in the value field. The grid system has 12 columns in total:<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: width1,width2',1,'0000-00-00 00:00:00'),(1999,'fr','help_text_UNANSWERED_DISPLAY_ROWS','Comma separated list of fields to show on a specific Unanswered reports. The fields are the one defined as COLUMN_UNANSWERED.<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: comma separated list of fields',1,'0000-00-00 00:00:00'),(2000,'fr','help_text_agent_filter','Regular Expression to filter unwanted Agents from initial selection.<br/> Example: <strong>Agent/[0-9][0-9][0-9][0-9]$</strong>\r\n\r\n\r\n\r\n',1,'0000-00-00 00:00:00'),(2001,'fr','help_text_agent_reports','Comma separated list of reports to show on the Agent page. You must specify the correct .php file that displays the report you want on each element.',1,'0000-00-00 00:00:00'),(2002,'fr','help_text_agent_row_color','To paint the whole cell background to the status color for an agent in the realtime view, set thi