00'),(2738,'ru','answered_calls_by_duration','Отвеченные по длительности вызова',0,'0000-00-00 00:00:00'),(2739,'ru','answered_calls_by_event','Причина разъединения',0,'0000-00-00 00:00:00'),(2740,'ru','answered_calls_by_holdtime','Уровень обслуживания',0,'0000-00-00 00:00:00'),(2741,'ru','answered_calls_by_queue','в очереди',0,'0000-00-00 00:00:00'),(2742,'ru','answered_calls_by_url','по URL-адресу',0,'0000-00-00 00:00:00'),(2743,'ru','answered_calls_detail','Описание отвеченных вызовов',0,'0000-00-00 00:00:00'),(2744,'ru','answered_calls_summary','Сводка отвеченных вызовов',0,'0000-00-00 00:00:00'),(2745,'ru','answered_calls_transferred','Переадресованный вызов',0,'0000-00-00 00:00:00'),(2746,'ru','at hour','в час',0,'0000-00-00 00:00:00'),(2747,'ru','at minute','в минуту',0,'0000-00-00 00:00:00'),(2748,'ru','calls','вызовы',0,'0000-00-00 00:00:00'),(2749,'ru','day','день',0,'0000-00-00 00:00:00'),(2750,'ru','disposition_help_ABANDON','Абонент отменил позицию в очереди. Позицией является позиция абонента в очереди после завершения вызова. Исходной позицией является исходная позиция абонента в тот момент, когда вызов впервые попал в очередь. Время ожидания - это общее время, которое вызов ожидал в очереди до момента отключения от системы. The caller abandoned their position in the queue. The position is the\r\ncaller&rsquo;s position in the queue when they hungup, the origposition is\r\nthe original position the caller was when they first entered the\r\nqueue, and the waittime is how long the call had been waiting in the\r\nqueue at the time of disconnect.',0,'0000-00-00 00:00:00'),(2751,'ru','disposition_help_COMPLETEAGENT','Абонент был соединен с оператором, вызов был завершен в обычном режиме *оператором*. Время удержания и продолжительность вызова сохранены. Исходная позиция абонента в очереди сохранена в origposition. The caller was connected to an agent, and the call was terminated normally\r\nby the *agent*. The caller&lsquo;s hold time and the length of the call are both\r\nrecorded. The caller&lsquo;s original position in the queue is recorded in\r\norigposition.',0,'0000-00-00 00:00:00'),(2752,'ru','disposition_help_COMPLETECALLER','Абонент был соединен с оператором, вызов был завершен в обычном режиме *абонентом*. Время удрежания и продолжительность вызова сохранены. Исходная позиция абонента в очереди сохранена в origposition. The caller was connected to an agent, and the call was terminated normally\r\nby the *caller*. The callers hold time and the length of the call are both\r\nrecorded. The caller&rsquo;s original position in the queue is recorded in\r\norigposition.\r\n',0,'0000-00-00 00:00:00'),(2753,'ru','disposition_help_CONNECT','Абонент соединен с оператором.',0,'0000-00-00 00:00:00'),(2754,'ru','disposition_help_ENTERQUEUE','A caller entered the queue. Three parameters are also written: the URL (if specified) in the Info 1 field and the caller ID of the caller on the Info 2 field, and the original position where the call has landed in the Info 3 field.\r\nВызов поступил в очередь. Записываются три парамтера: в поле Инфо 1 вносится URL-адрес (при наличии), в поле Инфо 2 вносится ID абонента, в поле Инфо 3 вносится начальное положение вызова при поступлении.',0,'0000-00-00 00:00:00'),(2755,'ru','disposition_help_EXITWITEMPTY','Абоненты был отключен от очереди принудительно по причине отсутствия доступных операторов и того, что система настроена таким образом, отключать абонентов при отсутствии доступных операторов. The caller was exited from the queue forcefully because the queue had no\r\nreachable members and it&lsquo;s configured to do that to callers when there\r\nare no reachable members. The position is the caller&lsquo;s position in the\r\nqueue when they hungup, the origposition is the original position the\r\ncaller was when they first entered the queue, and the waittime is how\r\nlong the call had been waiting in the queue at the time of disconnect.',0,'0000-00-00 00:00:00'),(2756,'ru','disposition_help_EXITWITHKEY','Абонент решил воспользоваться кнопками меню для выхода из очереди. Кнопка и позиция абонента в очереди сохранены.  The caller elected to use a menu key to exit the queue. The key and\r\nthe caller&lsquo;s position in the queue are recorded.\r\n',0,'0000-00-00 00:00:00'),(2757,'ru','disposition_help_EXITWITHTIMEOUT','Абонент находился в режиме удержания слишком долго, и время ожидания истекло.',0,'0000-00-00 00:00:00'),(2758,'ru','disposition_help_RINGNOANSWER','Время ожидания ответа от участника очереди превышено. Фиксируется единичный параметр, указывающий общее время, в течение которого звонил добавочнй номер участника очереди, в поле Инфо 1. The timeout value for ringing the queue member was exceeded. A single parameter will also be written indicating the amount of time the member’s extension rang in the Info 1 field.',0,'0000-00-00 00:00:00'),(2759,'ru','disposition_help_TRANSFER','Вызов абонента был переведен на другой добавочный номер. Контекст и добавочный номер сохранены. Время удрежания и продолжительность вызова сохранены. ПОЖАЛУЙСТА, помните о том, что переадресация, выполненая SIP UA&lsquo;s при использовании опции \"повторно\" не всегда распознаются Asterisk и  запуск события. Context and extension\r\nare recorded.The caller&lsquo;s hold time and the length of the call are both\r\nrecorded. PLEASE remember that transfers performed by SIP UA&lsquo;s by way\r\nof a reinvite may not always be caught by Asterisk and trigger off this\r\nevent. Единственным способом для осуществления переадресации участником очереди, при котором Вы можете со 100-процентным результатом получить событие, является использование встроенного функционала переадресации в Фыеукшыл/ The only way to be 100% sure that you will get this event when\r\na transfer is performed by a queue member is to use the built-in transfer\r\nfunctionality of Asterisk.',0,'0000-00-00 00:00:00'),(2760,'ru','distribution_by_day','по дням',0,'0000-00-00 00:00:00'),(2761,'ru','distribution_by_day_of_week','по дням недели',0,'0000-00-00 00:00:00'),(2762,'ru','distribution_by_hour','по часам',0,'0000-00-00 00:00:00'),(2763,'ru','distribution_by_month','по месяцам',0,'0000-00-00 00:00:00'),(2764,'ru','distribution_by_queue','по очереди',0,'0000-00-00 00:00:00'),(2765,'ru','distribution_by_url','по URL-адресу',0,'0000-00-00 00:00:00'),(2766,'ru','distribution_by_week','по неделям',0,'0000-00-00 00:00:00'),(2767,'ru','distribution_detail','Подробный отчет распределения вызовов',0,'0000-00-00 00:00:00'),(2768,'ru','distribution_summary','Сводка распределения вызовов',0,'0000-00-00 00:00:00'),(2769,'ru','event_help_abandon_info1','Позиция - это позиция абонента в очереди после того, как абонент завершил вызов.',0,'0000-00-00 00:00:00'),(2770,'ru','event_help_abandon_info2','Исходная позиция абонента после того, как вызов был направлен в очередь.',0,'0000-00-00 00:00:00'),(2771,'ru','event_help_abandon_info3','Время ожидания - общее время, которое вызов ожида ответа в очереди во время отключения от системы. The waittime is how long the call had been waiting in the queue at the time of disconnect.',0,'0000-00-00 00:00:00'),(2772,'ru','event_help_agentcallbacklogin_info1','Оператор обратной связи вошел в систему. Добавочный номер и контекст сохранены. The callback agent logged in. The login extension and context is recorded.',0,'0000-00-00 00:00:00'),(2773,'ru','event_help_agentcallbacklogoff_info1','Оператор обратных вызовов вышел из системы.',0,'0000-00-00 00:00:00'),(2774,'ru','event_help_agentcallbacklogoff_info2','Последний добавочный номер регистрации и контекст, а также общее время нахождения оператора в системе сохранены.',0,'0000-00-00 00:00:00'),(2775,'ru','event_help_agentcallbacklogoff_info3','Причины выхода из системы, при условии, что это был не обычный выход из системы. (Например, автоматический выход из системы, канал не доступен) The reason for the logoff if it was not a normal logoff (e.g., Autologoff, Chanunavail)',0,'0000-00-00 00:00:00'),(2776,'ru','event_help_agentlogin_info1','Оператор вошел в систему. Канал записывается. The agent logged in. The channel is recorded.',0,'0000-00-00 00:00:00'),(2777,'ru','event_help_agentlogoff_info1','Оператор вышел из системы.',0,'0000-00-00 00:00:00'),(2778,'ru','event_help_agentlogoff_info2','Общее время нахождения оператора в системе.',0,'0000-00-00 00:00:00'),(2779,'ru','event_help_completeagent_info1','Время удержания вызова абонента&#39;.',0,'0000-00-00 00:00:00'),(2780,'ru','event_help_completeagent_info2','Продолжительность вызова.',0,'0000-00-00 00:00:00'),(2781,'ru','event_help_completeagent_info3','Исходная позиция абонента в очереди сохраняется в origposition.',0,'0000-00-00 00:00:00'),(2782,'ru','event_help_completecaller_info1','Время удержания вызова абонента&#39;.',0,'0000-00-00 00:00:00'),(2783,'ru','event_help_completecaller_info2','Продолжительность вызова.',0,'0000-00-00 00:00:00'),(2784,'ru','event_help_completecaller_info3','Исходная позиция абонента сохранена в origposition.',0,'0000-00-00 00:00:00'),(2785,'ru','event_help_connect_info1','Время удержания вызова - общее время нахождения вызова в режиме удержания.',0,'0000-00-00 00:00:00'),(2786,'ru','event_help_connect_info3','Время звонка - промежуток времени между моментом поступления вызова в очередь и моментом, когда на вызов\r\nбыл получен ответ оператора.',0,'0000-00-00 00:00:00'),(2787,'ru','event_help_enterqueue_info1','URL параметр ',0,'0000-00-00 00:00:00'),(2788,'ru','event_help_enterqueue_info2','Идентификатор абонента',0,'0000-00-00 00:00:00'),(2789,'ru','event_help_enterqueue_info3','Исходная позиция абонента при направлении вызова в очередь в первый раз. The original position the caller was positioned when they first entered the queue.',0,'0000-00-00 00:00:00'),(2790,'ru','event_help_exitempty_info1','Позиция абонента в очереди после завершения вызова.',0,'0000-00-00 00:00:00'),(2791,'ru','event_help_exitempty_info2','Origposition - это исходная позиция абонента, когда он в первый раз попал в очередь. is the original position the caller was when they first entered the queue.',0,'0000-00-00 00:00:00'),(2792,'ru','event_help_exitempty_info3','Время ожидания - это общее время, которое вызов ожидал ответа в очереди во время отключения от системы.',0,'0000-00-00 00:00:00'),(2793,'ru','event_help_exitwithkey_info1','Абонент выбрал использование кнопок меню для выхода из очереди.',0,'0000-00-00 00:00:00'),(2794,'ru','event_help_exitwithkey_info2','Позиция абонента.',0,'0000-00-00 00:00:00'),(2795,'ru','event_help_exitwithtimeout_info1','Позиция абонента при выходе из очереди.',0,'0000-00-00 00:00:00'),(2796,'ru','event_help_exitwithtimeout_info2','Исходная позиция абонента при попадании в очередь. Original position at which the called entered the queue.',0,'0000-00-00 00:00:00'),(2797,'ru','event_help_exitwithtimeout_info3','Общее время, которое абонент провел в очереди.',0,'0000-00-00 00:00:00'),(2798,'ru','event_help_pause_info1','Причина постановки вызова на паузу (при наличии)',0,'0000-00-00 00:00:00'),(2799,'ru','event_help_ringnoanswer_info1','Время в миллисекундах, которое звонил телефон оператора до того момента, когда был достигнут лимит ожидания ответа. Попытка дозвона, окончившаяся тем, что оператор не принял вызов. Time in milliseconds the agent phone rang until the timeout was reached. The attempt ended without the member picking up the call. Bad queue member!',0,'0000-00-00 00:00:00'),(2800,'ru','event_help_transfer_info1','Добавочный номер',0,'0000-00-00 00:00:00'),(2801,'ru','event_help_transfer_info2','Контекст',0,'0000-00-00 00:00:00'),(2802,'ru','event_help_transfer_info3','Время удержания вызова абонента&#39;.',0,'0000-00-00 00:00:00'),(2803,'ru','event_help_transfer_info4','Продолжительность вызова.',0,'0000-00-00 00:00:00'),(2804,'ru','event_help_transfer_info5','Позиция абонента во время переадресации вызова.',0,'0000-00-00 00:00:00'),(2805,'ru','event_help_unpause_info1','Причина снятия вызова с паузы (при наличии). ',0,'0000-00-00 00:00:00'),(2806,'ru','every day','каждый день',0,'0000-00-00 00:00:00'),(2807,'ru','every hour','каждый час',0,'0000-00-00 00:00:00'),(2808,'ru','every minute','каждую минуту',0,'0000-00-00 00:00:00'),(2809,'ru','help_text_ACTION','Определяет обработчика действий абонента, таким образом, Вы можете вызвать собственные функции/программы для обработки особых случаев. Вам необходимо создать функцию javascript в файле js/custom.js. При нажатии на иконку события он получит уникальный идентификатор вызова. Define a custom action handler, so you can call your own functions/program to handle special cases. You must create the javascript function in the js/custom.js file. It will receive the unique id of the call when the action icon is clicked.<br/>\r\n<br/>\r\nparameter: position,icon image,Tooltip<br/>\r\nvalue: javascript_function',0,'0000-00-00 00:00:00'),(2810,'ru','help_text_ANSWERED_DISPLAY_GRID','Если диаграмма задается во вкладке отчетов отвеченных вызовов, поле параметра, то используйте ширину сетчатой схемы в качестве настройки в поле значения. Сетка состоит из 12 столбцов: If a chart is defined in the answered reports tab, parameter field, then use the grid layout width as setup in the value field. The grid system has 12 columns in total:<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: width1,width2',0,'0000-00-00 00:00:00'),(2811,'ru','help_text_ANSWERED_DISPLAY_ROWS','Список полей, разделенный запятой, отображающийся в отчетах отвеченных вызовов. Поля определяются как COLUMN_ANSWERED.<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: comma separated list of fields ',0,'0000-00-00 00:00:00'),(2812,'ru','help_text_CHART_ANSWERED','Отображает график на странице отчетов отвеченных вызовов.<br/><br/>\r\n\r\nparameter: position,group field,title<br/>\r\nvalue: field,field',0,'0000-00-00 00:00:00'),(2813,'ru','help_text_CHART_DISTRIBUTION','Отображает график на странице отчетов распределения вызовов. <br/><br/>\r\n\r\nparameter: position,group field,title<br/>\r\nvalue: field,field',0,'0000-00-00 00:00:00'),(2814,'ru','help_text_CHART_SERIES_COLOR','Цвета, используемые для построения диаграмм. Параметром является положение указателя, значением - шестнадцатиричный html цвет. Colors to use for charts. Parameter is the index position, and value the hex html color.',0,'0000-00-00 00:00:00'),(2815,'ru','help_text_CHART_UNANSWERED','Отображает график на странице отчетов неотвеченных вызовов.<br/><br/>\r\n\r\nparameter: position,group field,title<br/>\r\nvalue: field,field',0,'0000-00-00 00:00:00'),(2816,'ru','help_text_COLUMN_ANSWERED','Столбец в отчетах отвеченных вызовов. Вы можете добавить в отчет все столбцы, затем отсортировать их по каждой группе при помощи присвоения нумерации элементам списка ANSWERED_DISPLAY_ROWS.\r\nColumn to show in Answered reports. You can add all the columns you want for a report, then you can filter limit them on each group report by enumerating them in ANSWERED_DISPLAY_ROWS entries.<br/>\r\n<br/>\r\nparameter: column name/label<br/>\r\nvalue: variable or formula<br/>\r\n\r\n',0,'0000-00-00 00:00:00'),(2817,'ru','help_text_COLUMN_ANSWERED_FORMAT','Формат отображения значения ячейки в отчетах отвеченных вызовов. Применяются общие правила форматирования печати за исключением часовых значений: {ЧЧ}, {ММ}, {СС}, {мм} и {сс}<br/>\r\n<br/>\r\nparameter: field name<br/>\r\nvalue: format string<br/>\r\n<br/>\r\nИмя поля параметра задается в качестве поля параметра в The parameter field name must be set as the parameter field on the COLUMN_ANSWERED entry.<br/>\r\nПример форматирования:<br/><br/>\r\nЗначение в секундах переводится в формат ЧЧ:ММ:СС с:<br/>\r\n{ЧЧ}:{ММ}:{СС}\r\n',0,'0000-00-00 00:00:00'),(2818,'ru','help_text_COLUMN_DISTRIBUTION','Столбец в отчетах распределения вызовов. Вы можете добавить в отчет все столбцы, затем отсортировать их по каждой группе при помощи присвоения нумерации элементам списка DISTRIBUTION_DISPLAY_ROWS.<br/>\r\n<br/>\r\nparameter: column name/label<br/>\r\nvalue: variable or formula<br/>',0,'0000-00-00 00:00:00'),(2819,'ru','help_text_COLUMN_DISTRIBUTION_FORMAT','Формат отображения значения ячейки в отчетах распределения вызовов. Применяются общие правила форматирования печати за исключением часовых значений: {ЧЧ}, {ММ}, {СС}, {мм} и {сс}<br/>\r\n<br/>\r\nparameter: field name<br/>\r\nvalue: format string<br/>\r\n<br/>\r\nИмя поля параметра задается в качестве поля параметра в The parameter field name must be set as the parameter field on the COLUMN_DISTRIBUTION entry.<br/>\r\nПример форматирования:<br/><br/>\r\nЗначение в секундах переводится в формат ЧЧ:ММ:СС с:<br/>\r\n{ЧЧ}:{ММ}:{СС}\r\n\r\n',0,'0000-00-00 00:00:00'),(2820,'ru','help_text_COLUMN_REALTIME','Столбец сводки в реальном времени. Вы можете добавить в отчет все столбцы, затем отсортировать их по группам при помощи присвоения нумерации элементам списка REALTIME_DISPLAY_ROWS.<br/>\r\n<br/>\r\nparameter: column name/label<br/>\r\nvalue: variable or formula<br/>',0,'0000-00-00 00:00:00'),(2821,'ru','help_text_COLUMN_REALTIME_FORMAT','Format to use for displaying a cell value in the realtime queue summary report.Формат отображения значения ячейки в сводке по очереди в реальном времени. Применяются общие правила форматирования печати за исключением часовых значений: {ЧЧ}, {ММ}, {СС}, {мм} и {сс}<br/>\r\n<br/>\r\nparameter: field name<br/>\r\nvalue: format string<br/>\r\n<br/>\r\nИмя поля параметра задается в качестве поля параметра в The parameter field name must be set as the parameter field on the COLUMN_REALTIME entry.<br/>\r\nПример форматирования:<br/><br/>\r\nЗначение в секундах переводится в формат ЧЧ:ММ:СС с:<br/>\r\n{ЧЧ}:{ММ}:{СС}\r\n',0,'0000-00-00 00:00:00'),(2822,'ru','help_text_COLUMN_REALTIME_STYLE','Для дополнительного форматирования ячеек в таблице сводок очередей, отображающих информацию в реальном времени, Вы можете использовать HTML-класс или стиль текста. Например:<br/>\r\n<br/>\r\nclass=&quot;bigblue&quot;\r\n<br/>\r\nstyle=&quot;border:1px solid red;&quot;\r\n\r\n',0,'0000-00-00 00:00:00'),(2823,'ru','help_text_COLUMN_UNANSWERED','Столбец в отчете неотвеченных вызовов. Вы можете добавить в отчет все столбцы, затем отсортировать их по группам при помощи присвоения нумерации элементам списка UNANSWERED_DISPLAY_ROWS.<br/>\r\n<br/>\r\nparameter: column name/label<br/>\r\nvalue: variable or formula<br/>',0,'0000-00-00 00:00:00'),(2824,'ru','help_text_COLUMN_UNANSWERED_FORMAT','Формат отображения значения ячейки в отчетах неотвеченных вызовов. Применяются общие правила форматирования печати за исключением часовых значений: {ЧЧ}, {ММ}, {СС}, {мм} и {сс}<br/>\r\n<br/>\r\nparameter: field name<br/>\r\nvalue: format string<br/>\r\n<br/>\r\nИмя поля параметра задается в качестве поля параметра в The parameter field name must be set as the parameter field on the COLUMN_UNANSWERED entry.<br/>\r\nПример форматирования:<br/><br/>\r\nЗначение в секундах переводится в формат ЧЧ:ММ:СС с:<br/>\r\n{ЧЧ}:{ММ}:{СС}\r\n\r\n\r\n',0,'0000-00-00 00:00:00'),(2825,'ru','help_text_DISTRIBUTION_DISPLAY_ROWS','Список полей, разделенный запятой, отображающийся в отчетах распределения вызовов. Поля определяются как COLUMN_DISTRIBUTION.<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: comma separated list of fields',0,'0000-00-00 00:00:00'),(2826,'ru','help_text_EVENT_ABANDONED','Определяет события queue_log, которые подсчитывают счетчики/переменные, связанные с НЕСОСТОЯВШИМИСЯ ВЫЗОВАМИ, с использованием списка, разделенного запятыми. В стандартных настройках Asterisk должно быть установлено только \\\"ABANDON\\\". Define the queue_log events that will count towards the ABANDONED counters/variables in reports, using a comma separated list. In a standard Asterisk setup, this must be set to \\\"ABANDON\\\" and nothing else.счетчики/переменные ',0,'0000-00-00 00:00:00'),(2827,'ru','help_text_EVENT_ANSWERED','Определяет события queue_log, которые подсчитывают счетчики/переменные, связанные с ОТВЕЧЕННЫМИ ВЫЗОВАМИ, с использованием списка, разделенного запятыми. Define the queue_log events that will count towards the ANSWERED counters/variables in reports, using a comma separated list. Normal answered dispositions in the queue_log are COMPLETECALLER, COMPLETEAGENT, you could also want to count the TRANSFER disposition towards the ANSWERED column, but as transfers have their own variable, you can also leave them separated. Отвеченный вызов в queue_log обозначается COMPLETECALLER, COMPLETEAGENT. Вы также можете подсчитать количество результатов ПЕРЕАДРЕСОВАННЫЕ ВЫЗОВЫ в столбце ОТВЕЧЕННЫЕ ВЫЗОВЫ, но так как для переадресованных вызовов есть свои переменные, то они могут будет подсчитаны отдельно.',0,'0000-00-00 00:00:00'),(2828,'ru','help_text_EVENT_LOGIN','Определяет события queue_log, которые подсчитывают счетчики/переменные, связанные со ВХОДОМ В СИСТЕМУ, с использованием списка, разделенного запятыми.Как правило, имеются события AGENTLOGIN и ADDMEMBER в качестве действий по входу в систему в файле queue_log. В предыдущих версиях Asterisk также могут использоваться AGENTCALLBACKLOGIN.',0,'0000-00-00 00:00:00'),(2829,'ru','help_text_EVENT_LOGOUT','Определяет события queue_log, которые подсчитывают счетчики/переменные, связанные с ВЫХОДОМ ИЗ СИСТЕМЫ, с использованием списка, разделенного запятыми. Как правило, имеются AGENTLOGOFF и REMOVEMEMBER в качестве действий по выходу из системы в файле queue_log.',0,'0000-00-00 00:00:00'),(2830,'ru','help_text_EVENT_RECEIVED','Определяет события queue_log, которые подсчитывают счетчики/переменные, связанные с ПОЛУЧЕННЫМИ ВЫЗОВАМИ, с использованием списка, разделенного запятыми. Все результаты обработки вызовов в файле queue_log, имеющие отношение к полученным вызовам, должны быть перечислены здесь, например:<br/><br/>\r\nCOMPLETECALLER,COMPLETEAGENT,ABANDON,EXITEMPTY,EXITWITHKEY,EXITWITHTIMEOUT,TRANSFER',0,'0000-00-00 00:00:00'),(2831,'ru','help_text_EVENT_TRANSFERRED','Определяет события queue_log, которые подсчитывают счетчики/переменные, связанные с ПЕРЕАДРЕСОВАННЫМИ ВЫЗОВАМИ, с использованием списка, разделенного запятыми. В стандартных настройках Asterisk единственным событием, относящийся к переадрессации, является TRANSFER.',0,'0000-00-00 00:00:00'),(2832,'ru','help_text_EVENT_UNANSWERED','Определяет события queue_log, которые подсчитывают счетчики/переменные, связанные с НЕОТВЕЧЕННЫМИ ВЫЗОВАМИ, с использованием списка, разделенного запятыми. Так как для несостоявшегося вызова имеется собстввенная переменная, Вам необходимо перечислить все остальные результаты обработки вызовов как неотвеченные здесь, например:<br/><br/>\r\nEXITWITHKEY,EXITEMPTY,EXITWITHTIMEOUT',0,'0000-00-00 00:00:00'),(2833,'ru','help_text_REALTIME_COLUMN_WIDTHS','help_text_REALTIME_COLUMN_WIDTHS',0,'0000-00-00 00:00:00'),(2834,'ru','help_text_REALTIME_DISPLAY_ROWS','Список полей, разделенный запятой, отображающийся в таблице Сводки очередей в реальном времени. Поля определяются как COLUMN_REALTIME.<br/>\r\n<br/>\r\nparameter: group field (queue_summary)<br/>\r\nvalue: comma separated list of fields',0,'0000-00-00 00:00:00'),(2835,'ru','help_text_TOTAL_COLUMN_ANSWERED','Формула для строки \"Всего\" в отчете по отвеченным вызовам. Formula to use for the Total row on Answered reports.<br/>\r\n<br/>\r\nparameter: field<br/>\r\nvalue: formula',0,'0000-00-00 00:00:00'),(2836,'ru','help_text_TOTAL_COLUMN_DISTRIBUTION','Формула для строки \"Всего\" в отчете распределения вызовов.<br/>\r\n<br/>\r\nparameter: field<br/>\r\nvalue: formula',0,'0000-00-00 00:00:00'),(2837,'ru','help_text_TOTAL_COLUMN_REALTIME','Формула для строки \"Всего\" в отчетах в реальном времени.<br/>\r\n<br/>\r\nparameter: field<br/>\r\nvalue: formula',0,'0000-00-00 00:00:00'),(2838,'ru','help_text_TOTAL_COLUMN_UNANSWERED','Формула для строки \"Всего\" в отчете по неотвеченным вызовам.<br/>\r\n<br/>\r\nparameter: field<br/>\r\nvalue: formula',0,'0000-00-00 00:00:00'),(2839,'ru','help_text_UNANSWERED_DISPLAY_GRID','Если диаграмма задается в отчете неотвеченных вызовов, поле параметра, то используйте ширину сетчатой схемы в качестве настройки для значения поля. Сетка состоит из 12 столбцов: If a chart is defined in the unanswered reports, parameter field, then use the grid layout width as setup in the value field. The grid system has 12 columns in total:<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: width1,width2',0,'0000-00-00 00:00:00'),(2840,'ru','help_text_UNANSWERED_DISPLAY_ROWS','Список полей, разделенный запятой, отображающийся в отчетах неотвеченных вызовов. Поля определяются как COLUMN_UNANSWERED.<br/>\r\n<br/>\r\nparameter: group field<br/>\r\nvalue: comma separated list of fields',0,'0000-00-00 00:00:00'),(2841,'ru','help_text_agent_filter','Фильтр \"Регулярное выражение\" применяется для удаления из выделения ненужных операторов.<br/> Пример: <strong>Agent/[0-9][0-9][0-9][0-9]$</strong>\r\n\r\n\r\n',0,'0000-00-00 00:00:00'),(2842,'ru','help_text_agent_reports','Список отчетов, разделенный запятой, отображающийся на странице \"Оператор\". Вам необходимо задать правильный файл .php, отображающий необходимый Вам отчет по каждому элементу. Comma separated list of reports to show on the Agent page. You must specify the correct .php file that displays the report you want on each element.',0,'0000-00-00 00:00:00'),(2843,'ru','help_text_agent_row_color','Для придания ячейки цвета фона, соответствующего статусу оператора, в режиме реального времени, измените параметр на \"1\".',0,'0000-00-00 00:00:00'),(2844,'ru','help_text_answered_reports','Список отчетов, разделенный запятой, отображающийся на странице Отвеченных вызовов. Вам необходимо задать правильный файл .php, отображающий необходимый Вам отчет по каждому элементу. Comma separated list of reports to show on the Answered page. You must specify the correct .php file that displays the report you want on each element.',0,'0000-00-00 00:00:00'),(2845,'ru','help_text_asterisk_12','Установите значение \"1\", если Вы пользуетесь версией Asterisk 1.2 или более ранней версией. В противном случае возможно возникновение ограничений в использовании режима просмотра в реальном времени.',0,'0000-00-00 00:00:00'),(2846,'ru','help_text_avg_time_format','Формат поля средней продолжительности. ЧЧ = часы, ММ = минуты, СС = секунды, мм = полные минуты, сс = полные секунды. Используются в поисковых и подробных отчетах.',0,'0000-00-00 00:00:00'),(2847,'ru','help_text_call_time_format','Формат поля продолжительности вызова. ЧЧ = часы, ММ = минуты, СС = секунды, мм = полные минуты, сс = полные секунды. Используются в поисковых и подробных отчетах.',0,'0000-00-00 00:00:00'),(2848,'ru','help_text_csv_separator','Разделитель, используемый для экспорта файлов в формате CSV. По умолчанию разделителем является запятая (,). Если Вы пользуетесь LibreOffice/OpenOffice, то, возможно, потребуется изменить разделитель на точку с запятой (;). ',0,'0000-00-00 00:00:00'),(2849,'ru','help_text_custom_reports','Список индивидуальных отчетов, разделенный запятой, отображающийся в меню на вкладе \"Новый/Индивидуальный\". Параметром является название вклдаки для отображения, а значение - это список скрпитов .php, разделенные запятой, к загрузке. Comma separated list of custom reports to show on a new/custom tab on the menu. The parameter is the tab name to display, and value is a comma separated list of .php scripts to load.',0,'0000-00-00 00:00:00'),(2850,'ru','help_text_date_format','Формат поля даты с использованием синтаксиса MySQL. Например: %%м-%%д-%%Г %%Ч:%%м:%%с. Используется только в поисковых или полных отчетах. Формат отчета задается в конструкторе отчетов.',0,'0000-00-00 00:00:00'),(2851,'ru','help_text_decimal_places','Количество десятичных знаков для отображения чисел с плавающей запятой. ',0,'0000-00-00 00:00:00'),(2852,'ru','help_text_default_end_hour','Формат времени завершения по умолчанию ЧЧ:СС для выбора даты/времени.',0,'0000-00-00 00:00:00'),(2853,'ru','help_text_default_start_hour','Формат времени начала по умолчанию ЧЧ:СС для выбора даты/времени.',0,'0000-00-00 00:00:00'),(2854,'ru','help_text_detailed_agent_report','Отображает подробный отчет оператора во вкладке \"Оператор\". (Как и в случае  с детализированной информацией, представленной в периодическом отчете, но дополненной в соответствии с выбранным диапазонов дат). (Similar to the drill down information you can get on a regular report, but already expanded for the complete date range selection).',0,'0000-00-00 00:00:00'),(2855,'ru','help_text_dict_agent','Словарная запись для оператора. Заменяет идентификатор оператора, задаваемый в качестве параметра, на выбранное Вами значение (Таким образом, Вы можете использовать имя вместо номера).',0,'0000-00-00 00:00:00'),(2856,'ru','help_text_dict_queue','Словарная запись для очереди. Выполняет ту же функцию, что и словарная запись для оператора, но для замены имени очереди.',0,'0000-00-00 00:00:00'),(2857,'ru','help_text_distribution_interval','Интервал времени в минутахInterval in minutes to break up the distribution by hour report. По умолчанию интервал составляет час (60 минут), возможен выбор большего или меньшего значения. By default it breaks by hour (60 minutes), but you can use smaller or larger values.',0,'0000-00-00 00:00:00'),(2858,'ru','help_text_distribution_reports','Список отчетов, разделенный запятой, отображающийся на странице Распределения вызовов. Вам необходимо задать правильный файл .php, отображающий необходимый Вам отчет по каждому элементу. Comma separated list of reports to show on the Distribution page. You must specify the correct .php file that displays the report you want on each element.',0,'0000-00-00 00:00:00'),(2859,'ru','help_text_drilldown_records_per_page','Количество записей на странице отчета при разворачивании/детализации Number of records per page to show when expanding/drilling down on any report.',0,'0000-00-00 00:00:00'),(2860,'ru','help_text_first_page','Стартовая страница при загрузке (Например: answered.php, unanswered.php, distribution.php, agent.php). Возможно установить персональный вид стартовой страницы для каждого пользователя.',0,'0000-00-00 00:00:00'),(2861,'ru','help_text_hide_parsed_time','Установите значение \"1\", чтобы скрыть отображение в нижнем колонтитуле каждого отчета информации о времени обработки.',0,'0000-00-00 00:00:00'),(2862,'ru','help_text_ignore_none_abandons','Если Вы не хотите учитывать несостоявшиеся входящие вызовы при выборе в отчете нескольких операторов, измените параметр на \"один\". Эта функция полезна при отслеживании кампании исходящих вызовов и производительности каждого оператора, так как не учитываются несостоявшиеся входящие вызовы, распределенные в общую очередь (оператор \"NONE\"), но не прикрепленные к конкретному оператору. Если Вы выбираете всех операторов, включая и оператора \"NONE\", то несостоявшиеся входящие вызовы учитываются как обычно, даже если выбран параметр \"один\". \r\n',0,'0000-00-00 00:00:00'),(2863,'ru','help_text_language','Выбор языка. Если в поле параметра задать имя оператора, то использование языка будет ограничено для конкретного оператора. Если поле остается пустым, то выбранный язык применяется ко всем пользователям (основные настройки). Language to use. You can specify a user name in the parameter field to limit the language to a particular user. If the parameter field is left empty, then the language will be set for all users (global setting).',0,'0000-00-00 00:00:00'),(2864,'ru','help_text_mail_from_email','Для отправки запланированного отчета и уведомления электронным письмом, необходимо заполнить поле \"ОТ\".',0,'0000-00-00 00:00:00'),(2865,'ru','help_text_mail_from_name','Для отправки запланированного отчета и уведомления электронным письмом, необходимо заполнить поле \"ИМЯ\".',0,'0000-00-00 00:00:00'),(2866,'ru','help_text_mail_header_image','Файл изображения, используемый в качестве заголовка для отчетов/уведомлений, отправляемый электронной почтой.',0,'0000-00-00 00:00:00'),(2867,'ru','help_text_mail_smtp_password','При необходимости, для отправки запланированных отчетов и уведомлений введите пароль для SMTP-сервера.',0,'0000-00-00 00:00:00'),(2868,'ru','help_text_mail_smtp_server','Для отправки запланированных отчетов и уведомлений необходимо настроить SMTP-сервер. Наример: SSL-протокол: ssl://smtp.server.com ; TLS-протокол: tls://smtp.server.com ; без шифрования: smtp.server.com',0,'0000-00-00 00:00:00'),(2869,'ru','help_text_mail_smtp_server_port','При необходимости, для отправки запланированных отчетов и уведомления настройте SMTP-порт.',0,'0000-00-00 00:00:00'),(2870,'ru','help_text_mail_smtp_username','При необходимости, для отправки запланированных отчетов и уведомления введите имя пользователя для SMTP-сервера.',0,'0000-00-00 00:00:00'),(2871,'ru','help_text_realtime_alarm_call_duration','Предупреждающий сигнал, устанавливаемый для продолжительности вызова в секундах в режиме реального времени. Сигнал может быть задан для конкретной очереди путем Alarm in seconds for call duration in the realtime view. Can be set per queue by setting the parameter to the queue name.',0,'0000-00-00 00:00:00'),(2872,'ru','help_text_realtime_alarm_last_call','Предупреждающий сигнал в секундах, сообщающий о последнем вызове в режиме реального времени. Alarm in seconds for the last call information in the realtime view. Can be set per queue by setting the parameter to the queue name.',0,'0000-00-00 00:00:00'),(2873,'ru','help_text_realtime_alarm_pause_duration','Предупреждающий сигнал в секундах, сообщающий о продолжительности паузы/перерыва в режиме реального времени. Alarm in seconds for pause/break duration in the realtime view. Can be set per queue by setting the parameter to the queue name.',0,'0000-00-00 00:00:00'),(2874,'ru','help_text_realtime_alarm_row_color','Цвет фона строки, когда показатель Background row color when a value is in alarm in the realtime view.',0,'0000-00-00 00:00:00'),(2875,'ru','help_text_realtime_alarm_threshold','Пороговое значение (в процентах), начиная с которого вызовы обозначаются сигнальным цветом в режиме реального времени. Threshold (in percentage) from which to start coloring in alarm calls in the realtime view.',0,'0000-00-00 00:00:00'),(2876,'ru','help_text_realtime_alarm_wait_count','Предупреждающий сигнал для вызовов, ожидающих в очереди, в режиме реального времени. (Alarm (in number of calls) for calls waiting in a queue in the realtime view.',0,'0000-00-00 00:00:00'),(2877,'ru','help_text_realtime_alarm_wait_duration','Предупреждающий сигнал в секундах, устанавливаемый для продолжительности ожидания ответа в режиме реального времени. Alarm in seconds for call waiting duration in the realtime view. Can be set per queue by setting the parameter to the queue name.',0,'0000-00-00 00:00:00'),(2878,'ru','help_text_realtime_coach_options','Возможность для перехода в режим прослушивания вызова при запуске действия Тренер в реальном времени. Вы можете использовать любые варианты, доступные в приложении, например, Options to pass to chanspy when launching a Coach action from the realtime view. You can use any options available to the asterisk chanspy application, например &quot;w&quot; чтобы включить to enable whispering, or &quot;d&quot; to use dtmf to switch modes: 4 spy, 5 whisper, 6 barge., etc.',0,'0000-00-00 00:00:00'),(2879,'ru','help_text_realtime_custom_pauses','Если значение равно 1, то страница с просмотром в реальном времени будет проверять ASTDB на PAUSECUSTOM/Оператор и отобразит код паузы, хранящийся для конкретного Оператора в ASTDB.  If this value is set to 1 the realtime page will check the ASTDB for the PAUSECUSTOM/Agent family and it will show the pause code stored there for a particular Agent as stored in astdb Key. Например: PAUSECUSTOM/Agent/1000 = Break:${EPOCH}, сохраненный в ASTDB, will show Agent 1000 as break when paused.',0,'0000-00-00 00:00:00'),(2880,'ru','help_text_realtime_group_queues','Начать просмотр в реальном времени с отображением вызовов, сгруппированным по очередям обслуживания.',0,'0000-00-00 00:00:00'),(2881,'ru','help_text_realtime_hide_loggedoff','Начать просмотр в реальном времени без учета операторов, вышедших из системы. Start the realtime view without showing logged off Agents.',0,'0000-00-00 00:00:00'),(2882,'ru','help_text_realtime_refresh','Время обновления в секундах для режима просмота в реальном времени.',0,'0000-00-00 00:00:00'),(2883,'ru','help_text_realtime_refresh_sql','Время обновления в секундах для просмота статистики в таблице сводки очередей в реальном времени. Процесс получения информации оказывает большую нагрузку на процессор, поэтому для экономии возможно установить значние обновления по умолчанию 60 секунд или больше, если одновременно в реальном времени проверяют данные несколько супервизоров.',0,'0000-00-00 00:00:00'),(2884,'ru','help_text_realtime_reports','Список отчетов, разделенный запятой, отображающийся на странице Режима реального времени. Вам необходимо задать правильный файл .php, отображающий необходимый Вам отчет по каждому элементу. Comma separated list of reports to show on the Realtime page. You must specify the correct .php file that displays the report you want on each element.',0,'0000-00-00 00:00:00'),(2885,'ru','help_text_realtime_spy_device','Устройство, используемое пользователем (задается в поле параметра). Например: SIP/1234',0,'0000-00-00 00:00:00'),(2886,'ru','help_text_realtime_spy_extension','Добавочные номер для звонка на телефон супервизора при запуке действия перехвата вызова в режиме реального времени. Параметром должно являться им пользователя asternic, значением может быть добавочный номер с последующим контекстом, например: Extension to reach the supervisor phone when launching a call steal action in the realtime view. The parameter must be set to the asternic user name, the value could be the extension number followed by the context, for example: 100@from-internal',0,'0000-00-00 00:00:00'),(2887,'ru','help_text_realtime_spy_options','Возможность прослушать вызов при запуске действия \"Прослушать\" в режиме реального времени. Вы можете исползовать любые варианты, доступные в приложении прослушивания вызовов chanspy asterisk, например &quot;q&quot; отключить первый гудок, и т.п. Options to pass to chanspy when launching a Listen action from the realtime view. You can use any options available to the asterisk chanspy application, like &quot;q&quot; to disable the initial beep, etc.',0,'0000-00-00 00:00:00'),(2888,'ru','help_text_realtime_strict_interface_status','Данная настройка позволяет показывать статус режима просмотра в реальном времени, осуществляемое приложением Asterisk при помощи настроек STATE INTERFACE для приложения AddQueueMember. Для систем с участниками очереди локального типа с настройками STATE INTERFACE (например, FreePBX версия 2.8 или выше) необходимо установить значение 1. This setting will make the realtime view show status as returned by the asterisk queue application by means of the STATE INTERFACE options for the AddQueueMember application. It should be set to 1 in systems with Local type queue members with STATE INTERFACE set, like FreePBX 2.8 or higher.',0,'0000-00-00 00:00:00'),(2889,'ru','help_text_recordings_path','Местоположение записей на жестком диске в целях осуществления загрузки данных. Recordings location/directory in the hardrive to perform the direct download.',0,'0000-00-00 00:00:00'),(2890,'ru','help_text_session_time_format','Формат поля продолжительности обработки вызова. ЧЧ = часы, ММ = минуты, СС = секунды, мм = полные минуты, сс = полные секунды. Используются в отчетах оператора.',0,'0000-00-00 00:00:00'),(2891,'ru','help_text_setup_reports','Список отчетов, разделенный запятой, отображающийся на странице \"Параметры страницы\". Вам необходимо задать правильный файл .php, отображающий необходимый Вам отчет по каждому элементу. Comma separated list of reports to show on the Setup page. You must specify the correct .php file that displays the report you want on each element.',0,'0000-00-00 00:00:00'),(2892,'ru','help_text_short_abandon_threshold','Порог ожидания (в секундах) для того, чтобы вызов считался отмененным (если продолжительность вызова меньше заданного значения, то вызов полностью отклоняется). При указании имени очереди значение будет применимо только к этой очереди. Duration  treshhold (in seconds) for a call to be considered as abandoned (if duration is less than this value, then ignore the call completely). Specifying the queue name as a parameter will apply the value to that queue only.',0,'0000-00-00 00:00:00'),(2893,'ru','help_text_short_unanswered_threshold','Порог ожидания (в секундах) для вызова, чтобы считаться неотвеченным (если величина ожидания ниже установленного значения, то вызов не принимается во внимание). Задание имени очереди в качестве параметра определит значение только к заданной очереди. Duration  treshhold (in seconds) for a call to be considered as unanswered (if duration is less than this value, then ignore the call completely). Specifying the queue name as a parameter will apply the value to that queue only.',0,'0000-00-00 00:00:00'),(2894,'ru','help_text_show_agent_call','Отображает действия по завершению вызова при детализации отчета оператора. Show end call events when drilling down on agent reports',0,'0000-00-00 00:00:00'),(2895,'ru','help_text_show_url_field','Активировать и отобразить поле URL-адреса и отчетов',0,'0000-00-00 00:00:00'),(2896,'ru','help_text_sla_abandoned','Показатель уровня обслуживания в секундах для несостявшихся вызовов.',0,'0000-00-00 00:00:00'),(2897,'ru','help_text_sla_answered','Показатель уровня обслуживания в секундах для неотвеченных вызовов.',0,'0000-00-00 00:00:00'),(2898,'ru','help_text_sla_interval','Интервал времени в секундах для разделения таблицы для отчетов SLA (Соглашение об уровне обслуживания) и частоты отмены вызовов.',0,'0000-00-00 00:00:00'),(2899,'ru','help_text_sla_steps','Количество операций для отображения в отчетах SLA (Соглашение об уровне обслуживания) и частоты отмены вызовов.',0,'0000-00-00 00:00:00'),(2900,'ru','help_text_sla_transferred','Показатель уровня обслуживания в секундах для переадресованных вызовов.',0,'0000-00-00 00:00:00'),(2901,'ru','help_text_sla_unanswered','Показатель уровня обслуживания в секундах для неотвеченных (не отмененных, а неотвеченных в результате истечения времени ожидания, ) вызовов. вызовов. Service Level value in seconds for unanswered calls (not abandoned, but unanswered due to timeouts, exit with key, etc).',0,'0000-00-00 00:00:00'),(2902,'ru','help_text_timeframe_interval','Интервал времени в минутах - отображаются сведения о промежутке времени на домашней странице. Значение по умолчанию - 15 минут.',0,'0000-00-00 00:00:00'),(2903,'ru','help_text_timezone','Конфигурация часовго пояса для пользователя в формате [ -]ЧЧ:ММ\\\"\r\n\r\nЕсли имя пользователя задано в качестве параметра, то конфигурация применяется только к этому пользователю. Если поле остается пустым, конфигурация применяется повсеместно. If the user name is specified as parameter, then applies only to that user. If parameter is left blank it will be applied globally.',0,'0000-00-00 00:00:00'),(2904,'ru','help_text_unanswered_reports','Список отчетов, разделенный запятой, отображающийся на странице \"Неотвеченные вызовы\". Вам необходимо задать правильный файл .php, отображающий необходимый Вам отчет по каждому элементу. Comma separated list of reports to show on the Unanswered page. You must specify the correct .php file that displays the report you want on each element.',0,'0000-00-00 00:00:00'),(2905,'ru','help_text_variable_ABANDONED','Количество несостоявшихся вызовов (с результатом обработки вызова EVENT_ABANDON в queue_log).',0,'0000-00-00 00:00:00'),(2906,'ru','help_text_variable_ABANDONED_SLA','Количество несостоявшихся вызовов (с результатом обработки вызовов EVENT_ABANDON в queue_log)  с временем ожидания менее или равным значению sla_abandoned, заданному в Настройках.',0,'0000-00-00 00:00:00'),(2907,'ru','help_text_variable_ABANDONED_WAIT_T